import heapq

def labyrinth_solver(maze, start, end):
	# Bewegungsrichtungen (dx, dy): oben, rechts, unten, links
	directions = [(-1, 0), (0, 1), (1, 0), (0, -1)]
	rows, cols = len(maze), len(maze[0])
	
	# Priority Queue für Dijkstra (Kosten, Position, Richtungswechsel, letzte Richtung)
	pq = []
	heapq.heappush(pq, (0, start[0], start[1], -1))  # (Kosten, x, y, Richtung)
	
	# Besucht-Speicher: (x, y, letzte Richtung) -> minimale Kosten
	visited = {}
	
	while pq:
		cost, x, y, last_dir = heapq.heappop(pq)
		
		# Wenn wir am Ziel sind, geben wir die Kosten zurück
		if (x, y) == end:
			return cost
		
		# Skip, falls bereits ein besserer Zustand existiert
		if (x, y, last_dir) in visited and visited[(x, y, last_dir)] <= cost:
			continue
		visited[(x, y, last_dir)] = cost
		
		# Gehe alle möglichen Richtungen durch
		for dir_idx, (dx, dy) in enumerate(directions):
			nx, ny = x + dx, y + dy
			
			# Prüfen, ob die nächste Position im Labyrinth gültig ist
			if 0 <= nx < rows and 0 <= ny < cols and maze[nx][ny] != '#':
				# Berechne die neuen Kosten
				turn_cost = 0 if last_dir == -1 or last_dir == dir_idx else 1
				new_cost = cost + turn_cost
				
				# Füge neuen Zustand in die Priority Queue ein
				heapq.heappush(pq, (new_cost, nx, ny, dir_idx))
	
	return -1  # Kein Weg gefunden

